var players = []

var clutchDef = "30"

var buttons = ["30", "5", "2"]

function clearTable() {
	count = players.length
	console.log(count)
	table = document.getElementById("statTable")
	for(var i = 0; i < count; i++) {
		table.deleteRow(1)
	}
	return
}

function clearTable1() {
	clearTable()
	players = []
}

//makes new table when user changes definition of clutch
function generateTable() {
	console.log("Called generateTable")
	//call function to delete current table
	clearTable()
	count = players.length
	for(var i = 0; i < count; i++) {
			var item = players[i];
			var row = getPlayer(item)
			addRow(row)
	}
	return
}

function toggle(b) {
	if (b) {
		return false
	}
	return true
}

//responds to setting of clutchDefinition
function reactToClick(x) {
	console.log("Called reactToClick")
 //switch css outlines appropriately
 //run generate_table(timeframe) if playersList isn't empty
	document.getElementById(x).style.color = 'Blue'
	if (x == "30") {
		clutchDef = "30"
		document.getElementById("5").style.color = 'black'
		document.getElementById("2").style.color = 'black'
		if (toggle(players.length == 0)) {
 			generateTable()
 			return
 		}
		return
	}
	if (x == "5") {
		clutchDef = "5"
		document.getElementById("30").style.color = 'black'
		document.getElementById("2").style.color = 'black'
		if (toggle(players.length == 0)) {
 			generateTable()
 			return
 		}
		return
	}
	clutchDef = "2"
	document.getElementById("30").style.color = 'black'
	document.getElementById("5").style.color = 'black'
	if (toggle(players.length == 0)) {
 		generateTable()
 		return
 	}
return
}

function getPlayer(x) {
	if (clutchDef == "30") {
		var count = dataBase30.length
		for(var i = 0; i < count; i++) {
			var item = dataBase30[i];
			if (x == item[0]) {
				return item
			} 
			continue
		}
	}
	if (clutchDef == "5") {
		var count = dataBase5.length
		for(var i = 0; i < count; i++) {
			var item = dataBase5[i];
			if (x == item[0]) {
				return item
			}
			continue
		}
	}
	var count = dataBase2.length
	for(var i = 0; i < count; i++) {
		var item = dataBase2[i];
		if (x == item[0]) {
			return item
		}
		continue
	}
}

